  `sort` varchar(255) DEFAULT NULL COMMENT '排序',
  `notype` varchar(255) DEFAULT NULL COMMENT '是否是搭伙类型',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

