/*Table structure for table `highQualityProject` */

DROP TABLE IF EXISTS `highQualityProject`;

CREATE TABLE `highQualityProject` (
  `id` varchar(32) NOT NULL COMMENT '优质项目表Id标识',
  `releaseType` varchar(64) DEFAULT NULL COMMENT '项目类型，如：代理，众筹',
  `industryChoice` varchar(255) DEFAULT NULL COMMENT '行业',
  `personalId` varchar(64) DEFAULT 'admin' COMMENT '个人资料id，也就是信息的发布者，默认admin',
  `title` varchar(128) DEFAULT NULL COMMENT '标题',
  `threshold` int(11) DEFAULT NULL COMMENT '起投金额，单位:万',
  `projectDescription` varchar(1024) DEFAULT NULL COMMENT '项目描述',
  `projectIntroduction` text COMMENT '项目介绍',
  `dockingPlan` text COMMENT '对接方案',
  `standardofJoining` text COMMENT '加盟标准',
  `financingScheme` text COMMENT '融资方案',
  `shareholderPrivileges` text COMMENT '股东特权',
  `riskHints` text COMMENT '风险提示',
  `maxApplyNumber` int(11) DEFAULT '1' COMMENT '每人一次最多可申请的份数',
  `imageArray` varchar(1024) DEFAULT NULL COMMENT '图片',
  `state` int(11) DEFAULT '0' COMMENT '状态',
  `cdate` datetime DEFAULT NULL COMMENT '创建时间',
  `mdate` datetime DEFAULT NULL COMMENT '最后修改时间',
  `creator` varchar(32) DEFAULT 'admin' COMMENT '创建人',
  `uman` varchar(32) DEFAULT 'admin' COMMENT '修改人',
  `df` int(11) DEFAULT '0' COMMENT '是否删除',
  `version` int(11) DEFAULT '0' COMMENT '数据版本',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `highQualityProject` */

insert  into `highQualityProject`(`id`,`releaseType`,`industryChoice`,`personalId`,`title`,`threshold`,`projectDescription`,`projectIntroduction`,`dockingPlan`,`standardofJoining`,`financingScheme`,`shareholderPrivileges`,`riskHints`,`maxApplyNumber`,`imageArray`,`state`,`cdate`,`mdate`,`creator`,`uman`,`df`,`version`) values ('10001231','加盟代理','百货','admin','我们很清楚 如何帮你开好一家精品生活馆',25,'浙江乙尚丽品贸易有限公司旗下bubblekiss品牌，目前在浙江已经开设7家直营店，已进驻龙湖、万达、远洋、银泰等商场。现在面向贵州发展加盟事业，期待与你共同发展','[\r\n  {\r\n    \"content\": [\r\n      {\r\n	\"content\":\"我们很清楚 如何帮你开好一家精品生活馆\"\r\n      },\r\n      {\r\n        \"content\": \"2017年，BUBBLEKISS开了9家直营店，我们期待通过轻量级的城市合伙模式，完成2018年贵州地区10家加盟，\",\r\n        \"content_Bold\": \"将BUBBLEKISS的品牌、经营、管理、师资、资讯、广告、销售、体系贡献给精彩变革中的精品零售行业。\",\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/1.png\"\r\n      },\r\n      {\r\n        \"content\": \"我们想做什么\"\r\n      },\r\n      {\r\n        \"content\": \"BUBBLEKISS在国内，起步于2017年，是行业的后来者。我们专心做的是传播精品生活的理念和提升专业能力，一家店开好了，积累了一定的人气，我们才陆续开分店。\",\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/2.png\"\r\n      },\r\n      {\r\n        \"content\": \"截止到现在，\",\r\n        \"content_Bold\": \"在全国已经有了9家自己的直营店，已入驻远洋、龙湖、万达、银泰等知名商场，接待了无数消费者。\",\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/3.png\"\r\n      },\r\n      {\r\n        \"content\": \"在经营过程中，我们得到了非常多朋友的支持，可以这么说，销售超出了我们的预期，这样的认可也更加坚定了我们招募城市合伙伙伴的行业责任。\"\r\n      },\r\n      {\r\n        \"content_Bold\": \"时尚的精品生活快消品，在国内外都非常受欢迎，并且大众化的局面日益升温。\",\r\n        \"content_last\": \"市场进入洗牌阶段，缺乏完善的管理体系、参差不齐的管理水平的小门店的闭塞体验等势必淘汰。\",\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/4.png\"\r\n      },\r\n      {\r\n        \"content\": \"以往的实战经验告诉我，从客户与时俱进的需求出发才能最大化地实现价值。经营是需要口碑相传的，做好管理和运营都需要有实践实力，做到极致，才能分享给大家，不是说空话，而是谈经验。\",\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/5.png\"\r\n      },\r\n      {\r\n        \"content\": \"我们很清楚一个精品生活馆要开好需要具备什么条件，比如选址、客群定位、经营的程度、货品的精准配置，互联网智能的更新等。\"\r\n      },\r\n      {\r\n        \"content_Bold\": \"身边经常会有很多同行来向我们请教，但片面化的交流能提供的帮助毕竟有限，所以我们非常欢迎更多意向者加入BUBBLEKISS，共享BUBBLEKISS。\",\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/6.png\"\r\n      },\r\n      {\r\n        \"content_Bold\": \"我们的城市合伙人计划是要在2018年完成100家，第一年深耕细作，2020年达到500家，成为中国的精品生活馆领导品牌。\"\r\n      },\r\n      {\r\n        \"content\": \"BUBBLEKISS的模式首先是轻量级的，现在是大众创业万众创新的时代，我们希望让更多人懂得科学运营，懂得强化专业和服务，一起颠覆行业秩序，同时也为中国的精品生活馆产业贡献一些实实在在的力量。\"\r\n      },\r\n      {\r\n        \"content\": \"我们能做什么\"\r\n      },\r\n      {\r\n        \"content\": \"一直以来，BUBBLEKISS都着力于精品生活馆经营、门店销售人员培训、企业联盟合作、城市合伙等板块，我们做好了自己的经营，也有能力做好指导与布局。\"\r\n      },\r\n      {\r\n        \"content\": \"我们的运营团队已然成熟，包含了品牌、市场推广、拓展、培训、营销、售后服务、行政支持等八大中心；\"\r\n      },\r\n      {\r\n        \"content\": \"各版块负责人的管理经验都在5年以上，坚持以为消费者服务为先导，以不断挑战业绩指标为乐趣，团队的强大形成了我们无法替代的竞争力。\",\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/8.png\"\r\n      },\r\n      {\r\n        \"content\": \"这也更有助于我们对城市合伙人的交流与综合指导，\",\r\n        \"content_Bold\": \"BUBBLEKISS在如何选址、装修、动线设计、空间布局、后期的培训教育、系统化运营方面是成体系在持续运作的，所以开馆的前中后我们都可以提供实际的帮助。\"\r\n      },\r\n      {\r\n        \"content\": \"当然，我们一直顺应现代广告传播的需求，通过新媒体、网络、电台、期刊、杂志等各种形式进行全方位立体宣传。最重要的是，多年良好的口碑宣传渠道，也为BUBBLEKISS合伙人提供了有力保障。\",\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/8.png\"\r\n      },\r\n      {\r\n        \"content\": \"Bubblekiss已在全国设立了9个直营店，下一步将入驻贵州市场。\",\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/18.png\"\r\n      },\r\n      {\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/19.png\"\r\n      },\r\n      {\r\n        \"title\": \"台州市路桥区星光耀商场店\",\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/20.png\"\r\n      },\r\n      {\r\n        \"title\": \"杭州市拱墅远洋乐堤商场店\",\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/21.png\"\r\n      },\r\n      {\r\n        \"title\": \"杭州市下沙宝龙城市广场店\",\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/22.png\"\r\n      },\r\n      {\r\n        \"title\": \"杭州市滨江龙湖天街商场店\",\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/23.png\"\r\n      },\r\n      {\r\n        \"title\": \"宁波市鄞州区海港城商场店\",\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/24.png\"\r\n      },\r\n      {\r\n        \"title\": \"江苏省无锡江阴万达广场店\",\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/25.png\"\r\n      },\r\n      {\r\n        \"title\": \"金华市东阳东部银泰广场店\"\r\n      },\r\n      {\r\n        \"content\": \"发起原因\"\r\n      },\r\n      {\r\n        \"content\": \"寻找城市合伙人\"\r\n      },\r\n      {\r\n        \"content\": \"这次，我们为城市合伙人带来了全案合伙的方案，希望越来越多热爱精品生活馆事业、认同BUBBLEKISS经营理念，并且同样具备契约精神的伙伴加入我们。\",\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/26.png\"\r\n      },\r\n      {\r\n        \"content_Bold\": \"你准备好了吗？\"\r\n      },\r\n      {\r\n        \"content_Bold\": \"我们等你。\"\r\n      }\r\n    ]\r\n  },\r\n  {\r\n    \"title\": \"加盟方案\",\r\n    \"content\": [\r\n      {\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/27.png\"\r\n      }\r\n    ]\r\n  },\r\n  {\r\n    \"content\": [\r\n      {\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/17.png\"\r\n      }\r\n    ]\r\n  }\r\n]','[\r\n  {\r\n    \"title\": \"加盟方案\",\r\n    \"content\": [\r\n      {\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/27.png\"\r\n      }\r\n    ]\r\n  }\r\n]','[\r\n  {\r\n    \"content\": [\r\n      {\r\n        \"img\": \"https://static.daho.club/static/upload/web.daho.club/dahuo/jiamengdaili/17.png\"\r\n      }\r\n    ]\r\n  }\r\n]',NULL,NULL,NULL,3,'https://static.daho.club/static/upload/sys.daho.club/oNWj80KjQeJTnbWO5fGxGu9POkgU/20171125/d9dbe33a0ff64850804868c96bd9fe20.jpg',0,'2017-12-08 12:00:55','2017-12-08 12:00:58','admin','admin',0,0);

/*Table structure for table `highQualityProjectApply` */

DROP TABLE IF EXISTS `highQualityProjectApply`;

CREATE TABLE `highQualityProjectApply` (
  `id` varchar(32) NOT NULL COMMENT '优质项目申请表Id标识',
  `highQualityProjectId` varchar(32) NOT NULL COMMENT '优质项目Id',
  `personalId` varchar(32) DEFAULT NULL COMMENT '申请者id',
  `applyNumber` int(11) DEFAULT NULL COMMENT '申请份数',
  `amountofMoney` float DEFAULT NULL COMMENT '金额',
  `userName` varchar(32) DEFAULT NULL COMMENT '姓名',
  `phone` varchar(32) DEFAULT NULL COMMENT '电话',
  `userRemark` varchar(1024) DEFAULT NULL COMMENT '个人描述',
  `state` int(11) DEFAULT '0' COMMENT '状态, 0=众筹,1=加盟代理',
  `cdate` datetime DEFAULT NULL COMMENT '创建时间',
  `mdate` datetime DEFAULT NULL COMMENT '最后修改时间',
  `creator` varchar(32) DEFAULT NULL COMMENT '创建人',
  `uman` varchar(32) DEFAULT NULL COMMENT '修改人',
  `df` int(11) DEFAULT '0' COMMENT '是否删除',
  `version` int(11) DEFAULT '0' COMMENT '数据版本',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

